import { Box, Button } from '@mui/material';
import React from 'react';
import {FormControl,TextField} from '@mui/material';
import { makeStyles } from '@mui/styles';

const style = makeStyles({
  button:{
    color:'red'
  },
  label:{
    padding:'10px'
  },
  form:{
    display:'flex',
    flexDirection:'column',
    alignItems:'start'
  },
  inputBox:{
    width:'200px',
    padding:'10px'
  }
})

export default function SignupComponent() {
  const classes = style()
  return (
   <div>
    <form className={classes.form}>
      <span>
      <label className={classes.label}>Name</label><input type="text" className={classes.inputBox}></input></span>
      <span><label className={classes.label}>Password</label><input type='password' className={classes.inputBox}></input>
      </span><span> <label className={classes.label}>Mobile Number</label><input type='tel' className={classes.inputBox}></input></span>
      <button type='submit' className={classes.button}>Submit</button>
    </form>
   </div>
  )
}
